import './App.css';
import 'react-bootstrap';

function Mainbar() {
  return (
    <div class="mainbar"> 
        <div class="lmain">
            <a href="/"> </a>
        </div>
        <div class="rmain">
            <div class="btn-group">
                <a href="/register.php"> <button type="button" class="btn btn-light" >Zarejestruj 
                </button></a>
            </div>
            <div class="btn-group">
                <a href="/login.php"> <button type="button" class="btn btn-light" > Zaloguj
                </button></a>
            </div>
            
        </div>
    </div>
  );
}

export default Mainbar;
